import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './jsx/home';
import AdBanner from './jsx/AdBanner/AdBanner';
import Header from './jsx/header/header';
import Navigation from './jsx/nav/Navigation';
import Footer from './jsx/footer/Footer';
import LatestNews from './jsx/Components/latest/LatestNews'; // Ensure the correct import path

function App() {
  const apiBaseUrl = 'http://127.0.0.1:8000/apis';

  return (
    <Router>
      <div>
        <AdBanner />
        <Header />
        <Navigation />

        <Routes>
          <Route path="latest" element={<LatestNews fetchUrl={apiBaseUrl} />} />
          <Route path="/" element={<Home />} /> 
        </Routes>
      </div>
      <Footer />
    </Router>
  );
}

export default App;
